/*jslint node: true */
"use strict";

var cubeVertexPositionBuffer;
var cubeVertexIndexBufferTriStrip;
var cubeVertexIndexBufferFaceOutline;
var cubeVertexIndexBufferAllTriOutline;
var shaderProgram;
var time;
var animations = [];
var faces = [];

function Rotation() {
  this.x = 0;
  this.y = 0;
  this.z = 0;
}

function Face() {
  this.rot = new Rotation();
}

function toRad(deg) { return deg * Math.PI / 180; }

function initAnimations() {
  // notes:
  // initial panel rotation is to fixed angle 90°, 180° and 270°

  // animation sequence should be
  // 1. one panel (grid / lattice)
  // 2. split into 6 panels and swing around to form cube
  // 3. start to rotate cube
  // 4. rotate and lattice to coloured faces
  // 6. rotate and inflate to sphere
  // 7. coloured faces to "earth" texture with clouds
  // end. all effets undone and collapse back to original panel (grid / lattice)

  animations.current = 0;
  var animation = [], i = 0, j = 0;

  animation[0] = new morphPause(0.5);
  animations[j++] = animation;

  animation = [];
  animation[i++] = function (dt) { return true; };

  // open grid into cube
  animation[i] = new morphAngle(faces[i++], { x: { limit: toRad(90), rate: toRad(45) } });
  animation[i] = new morphAngle(faces[i++], { x: { limit: toRad(-90), rate: toRad(-45) } });
  animation[i] = new morphAngle(faces[i++], { y: { limit: toRad(90), rate: toRad(45) } });
  animation[i] = new morphAngle(faces[i++], { y: { limit: toRad(-90), rate: toRad(-45) } });
  animation[i] = new morphAngle(faces[i++], { y: { limit: toRad(-180), rate: toRad(-45) } });
  animations[j++] = animation;

  animation = [];
  animation[0] = new morphAngle(faces, { x: { limit: toRad(-30), rate: toRad(-10) }, y: { limit: toRad(-30), rate: toRad(-10) } });
  animations[j++] = animation;

  // fade through to all triangle lines
  // fade out all triangle lines
  animation = [];
  i = 0;
  animation[i] = new morphColour(faces[i++], { a: { limit: 1, rate: 0.05 } });
  animation[i] = new morphColour(faces[i++], { a: { limit: 1, rate: 0.05 } });
  animation[i] = new morphColour(faces[i++], { a: { limit: 1, rate: 0.05 } });
  animation[i] = new morphColour(faces[i++], { a: { limit: 1, rate: 0.05 } });
  animation[i] = new morphColour(faces[i++], { a: { limit: 1, rate: 0.05 } });
  animation[i] = new morphColour(faces[i++], { a: { limit: 1, rate: 0.05 } });

  var k = 0;
  animation[i++] = new morphLineColour(faces[k++], { a: { limit: 0, rate: -0.05 } });
  animation[i++] = new morphLineColour(faces[k++], { a: { limit: 0, rate: -0.05 } });
  animation[i++] = new morphLineColour(faces[k++], { a: { limit: 0, rate: -0.05 } });
  animation[i++] = new morphLineColour(faces[k++], { a: { limit: 0, rate: -0.05 } });
  animation[i++] = new morphLineColour(faces[k++], { a: { limit: 0, rate: -0.05 } });
  animation[i++] = new morphLineColour(faces[k++], { a: { limit: 0, rate: -0.05 } });

  animation[i] = new morphAngleContinuous(faces, { x: { rate: toRad(-10) }, y: { rate: toRad(-10) } });
  animations[j++] = animation;

  // just rotate for a bit
  animation = [];
  animation[0] = new morphPause(5);
  animation[1] = new morphAngleContinuous(faces, { x: { rate: toRad(-10) }, y: { rate: toRad(-10) } });
  animations[j++] = animation;

  // inflate to sphere
  animation = [];
  animation[0] = new morphAngleContinuous(faces, { x: { rate: toRad(-10) }, y: { rate: toRad(-10) } });
  animation[1] = new morphSphere(faces, { radius: faces.radius, rate: 10 });
  animations[j++] = animation;

  // just rotate for a bit
  animation = [];
  animation[0] = new morphPause(5);
  animation[1] = new morphAngleContinuous(faces, { x: { rate: toRad(-10) }, y: { rate: toRad(-10) } });
  animations[j++] = animation;

  // undo everything
  animation = [];
  i = 0;

  // close faces
  animation[i++] = function (dt) { return true; };
  animation[i] = new morphAngle(faces[i++], { x: { limit: toRad(0), rate: toRad(-90) } });
  animation[i] = new morphAngle(faces[i++], { x: { limit: toRad(0), rate: toRad(90) } });
  animation[i] = new morphAngle(faces[i++], { y: { limit: toRad(0), rate: toRad(-90) } });
  animation[i] = new morphAngle(faces[i++], { y: { limit: toRad(0), rate: toRad(90) } });
  animation[i] = new morphAngle(faces[i++], { y: { limit: toRad(0), rate: toRad(180) } });

  // deflate to cube
  animation[i++] = new morphCube(faces, { radius: faces.radius, rate: 1 });

  // fade through to all triangle lines
  // fade in all triangle lines
  k = 0;
  animation[i++] = new morphColour(faces[k++], { a: { limit: 0, rate: -0.5 } });
  animation[i++] = new morphColour(faces[k++], { a: { limit: 0, rate: -0.5 } });
  animation[i++] = new morphColour(faces[k++], { a: { limit: 0, rate: -0.5 } });
  animation[i++] = new morphColour(faces[k++], { a: { limit: 0, rate: -0.5 } });
  animation[i++] = new morphColour(faces[k++], { a: { limit: 0, rate: -0.5 } });
  animation[i++] = new morphColour(faces[k++], { a: { limit: 0, rate: -0.5 } });

  k = 0;
  animation[i++] = new morphLineColour(faces[k++], { a: { limit: 1, rate: 0.5 } });
  animation[i++] = new morphLineColour(faces[k++], { a: { limit: 1, rate: 0.5 } });
  animation[i++] = new morphLineColour(faces[k++], { a: { limit: 1, rate: 0.5 } });
  animation[i++] = new morphLineColour(faces[k++], { a: { limit: 1, rate: 0.5 } });
  animation[i++] = new morphLineColour(faces[k++], { a: { limit: 1, rate: 0.5 } });
  animation[i++] = new morphLineColour(faces[k++], { a: { limit: 1, rate: 0.5 } });

  // orient to 0°
  animation[0] = new morphAngle(faces, { x: { limit: toRad(0), rate: toRad(180) }, y: { limit: toRad(0), rate: toRad(180) } });

  animations[j++] = animation;
}
function handleLoadedTexture(texture, image) {
  gl.bindTexture(gl.TEXTURE_2D, texture);
  gl.texImage2D(gl.TEXTURE_2D, 0, gl.RGBA, gl.RGBA, gl.UNSIGNED_BYTE, image);
  gl.texParameteri(gl.TEXTURE_2D, gl.TEXTURE_WRAP_S, gl.CLAMP_TO_EDGE);
  gl.texParameteri(gl.TEXTURE_2D, gl.TEXTURE_WRAP_T, gl.CLAMP_TO_EDGE);
  gl.texParameteri(gl.TEXTURE_2D, gl.TEXTURE_MAG_FILTER, gl.NEAREST);
  gl.texParameteri(gl.TEXTURE_2D, gl.TEXTURE_MIN_FILTER, gl.NEAREST);
  gl.bindTexture(gl.TEXTURE_2D, null);
}

function init() {
  initWebGL();
  initShaderProgram();
  initGeometry();
  initAnimations();
  tick();
  getVariableLocations();
}

function getVariableLocations() {
  shaderProgram.u_target = gl.getUniformLocation(shaderProgram, 'target');
  shaderProgram.u_rad = gl.getUniformLocation(shaderProgram, 'rad');
  shaderProgram.u_radOffset = gl.getUniformLocation(shaderProgram, 'radOffset');
  shaderProgram.u_rot = gl.getUniformLocation(shaderProgram, 'rot');
  shaderProgram.u_cubeRot = gl.getUniformLocation(shaderProgram, 'cubeRot');
  shaderProgram.u_col = gl.getUniformLocation(shaderProgram, 'uColor');
  shaderProgram.u_z_off = gl.getUniformLocation(shaderProgram, 'z_off');
  shaderProgram.samplerUniform = gl.getUniformLocation(shaderProgram, "uSampler")

  shaderProgram.useTexture = gl.getUniformLocation(shaderProgram, "useTexture");
  shaderProgram.vertexPositionAttribute = gl.getAttribLocation(shaderProgram, "aVertexPosition");
  gl.enableVertexAttribArray(shaderProgram.vertexPositionAttribute);
}

function upStrip(rows, start) {
  var idxTriStrip = [];
  for (var i = start, r = 0; r < rows; r++) {
    idxTriStrip[2 * r] = r + start;
    idxTriStrip[2 * r + 1] = r + start + rows;
  }
  return idxTriStrip;
}

function dnStrip(rows, start) {
  var idxTriStrip = [];
  var o = 0;
  for (var i = start, r = rows; r > 0; r--) {
    idxTriStrip[o++] = r + start - rows;
    idxTriStrip[o++] = r + start;
  }
  return idxTriStrip;
}

function makePlane(size, rows) {
  var step = size / (rows - 1);
  var i = 0, s = size / 2;
  var t = [];
  for (var x = 0; x < rows; x++) {
    for (var y = 0; y < rows; y++) {
      t[i++] = -s + x * step;
      t[i++] = -s + y * step;
      t[i++] = -s;
    }
  }
  return t;
}

function initGeometry() {
  var size = 7;
  var rows = 16;

  faces.rot = new Rotation();
  faces.size = size;
  for (var i = 1; i < 7; i++) {
    faces[i - 1] = new Face();
    var c = { r: (+((i >> 2) & 1)), g: (+((i >> 1) & 1)), b: (+(i & 1)), a: 0 };
    faces[i - 1].colour = c;
    faces[i - 1].linecolour = { r: 0, g: 0, b: 0, a: 1 };
  }
  faces.radOffset = 0;
  faces.radius = Math.sqrt(3) * size * 0.5;
  faces.target = (1 - 1 / Math.sqrt(3)) * (faces.radius);

  var v = makePlane(size, rows);
  var idxTriStrip = upStrip(rows, 0);
  if (rows & 1 === 1) {
    for (var i = 1; i < rows / 2 - 1; i++) {
      idxTriStrip = idxTriStrip.concat(dnStrip(rows, idxTriStrip.slice(-1)[0]));
      idxTriStrip = idxTriStrip.concat(upStrip(rows, idxTriStrip.slice(-1)[0]));
    }
    idxTriStrip = idxTriStrip.concat(dnStrip(rows, idxTriStrip.slice(-1)[0]));
  } else {
    for (var i = 1; i < rows / 2; i++) {
      idxTriStrip = idxTriStrip.concat(dnStrip(rows, idxTriStrip.slice(-1)[0]));
      idxTriStrip = idxTriStrip.concat(upStrip(rows, idxTriStrip.slice(-1)[0]));
    }
  }
  var idxAllTris = idxTriStrip.slice();

  var step = idxAllTris.slice(-1)[0] + 1 === v.length / 3 ? -1 : 1;
  var i = idxAllTris.slice(-1)[0] + 1;
  for (var j = 0; j < rows; j++) {
    for (var k = 0; k < rows; k++) {
      i += step;
      idxAllTris.push(i);
    }
    i -= rows - step;
    step = -step;
  }

  var idxFaceOutline = [0, rows - 1, rows * rows - 1, rows * rows - rows, 0, rows * rows - 1];

  var vertices = new Float32Array(v);
  cubeVertexPositionBuffer = gl.createBuffer();
  gl.bindBuffer(gl.ARRAY_BUFFER, cubeVertexPositionBuffer);
  gl.bufferData(gl.ARRAY_BUFFER, vertices, gl.STATIC_DRAW);
  cubeVertexPositionBuffer.itemSize = 3;
  cubeVertexPositionBuffer.numItems = vertices.length / cubeVertexPositionBuffer.itemSize;

  var indices = new Uint16Array(idxTriStrip);
  cubeVertexIndexBufferTriStrip = gl.createBuffer();
  gl.bindBuffer(gl.ELEMENT_ARRAY_BUFFER, cubeVertexIndexBufferTriStrip);
  gl.bufferData(gl.ELEMENT_ARRAY_BUFFER, indices, gl.STATIC_DRAW);
  cubeVertexIndexBufferTriStrip.itemSize = 1;
  cubeVertexIndexBufferTriStrip.numItems = indices.length / cubeVertexIndexBufferTriStrip.itemSize;

  indices = new Uint16Array(idxFaceOutline);
  cubeVertexIndexBufferFaceOutline = gl.createBuffer();
  gl.bindBuffer(gl.ELEMENT_ARRAY_BUFFER, cubeVertexIndexBufferFaceOutline);
  gl.bufferData(gl.ELEMENT_ARRAY_BUFFER, indices, gl.STATIC_DRAW);
  cubeVertexIndexBufferFaceOutline.itemSize = 1;
  cubeVertexIndexBufferFaceOutline.numItems = indices.length / cubeVertexIndexBufferFaceOutline.itemSize;

  indices = new Uint16Array(idxAllTris);
  cubeVertexIndexBufferAllTriOutline = gl.createBuffer();
  gl.bindBuffer(gl.ELEMENT_ARRAY_BUFFER, cubeVertexIndexBufferAllTriOutline);
  gl.bufferData(gl.ELEMENT_ARRAY_BUFFER, indices, gl.STATIC_DRAW);
  cubeVertexIndexBufferAllTriOutline.itemSize = 1;
  cubeVertexIndexBufferAllTriOutline.numItems = indices.length / cubeVertexIndexBufferAllTriOutline.itemSize;

  // create texture
  var image = new Image();
  image.onload = function () {
    var texture = gl.createTexture();
    handleLoadedTexture(texture, image);

    for (var i = 0; i < faces.length; i++) {
      faces[i].texture = texture;
    }
  }

  image.src = "data:image/png;base64,";
}

function toArray(assArray) {
  var t = [];
  for (var items in assArray) {
    t.push(assArray[items]);
  }
  return t;
}

function draw(buffer, colour, primitiveType) {
  gl.uniform4fv(shaderProgram.u_col, colour);
  gl.bindBuffer(gl.ELEMENT_ARRAY_BUFFER, buffer);
  gl.drawElements(primitiveType, buffer.numItems, gl.UNSIGNED_SHORT, 0);
}

function drawAll() {
  gl.clearColor(0, 0.5, 0, 1);
  gl.clear(gl.COLOR_BUFFER_BIT | gl.DEPTH_BUFFER_BIT);
  gl.enable(gl.DEPTH_TEST);
  gl.enable(gl.BLEND);

  gl.blendFunc(gl.SRC_ALPHA, gl.ONE_MINUS_SRC_ALPHA);
  gl.blendFunc(gl.SRC_ALPHA, gl.SRC_ALPHA);
  gl.blendFunc(gl.ONE_MINUS_SRC_ALPHA, gl.SRC_ALPHA);
  gl.blendFunc(gl.SRC_ALPHA, gl.ONE);
  gl.blendFunc(gl.ONE, gl.SRC_ALPHA);
  //gl.blendFunc(gl.SRC_ALPHA, gl.DST_ALPHA);
  gl.blendFunc(gl.ONE, gl.ONE_MINUS_SRC_ALPHA);

  gl.blendFunc(gl.SRC_ALPHA, gl.ONE_MINUS_SRC_ALPHA);

  gl.bindBuffer(gl.ARRAY_BUFFER, cubeVertexPositionBuffer);
  gl.vertexAttribPointer(shaderProgram.vertexPositionAttribute, cubeVertexPositionBuffer.itemSize, gl.FLOAT, false, 0, 0);
  //gl.polygonOffset(0.1, 0.1);

  gl.uniform3fv(shaderProgram.u_cubeRot, toArray(faces.rot));
  gl.uniform1f(shaderProgram.u_rad, faces.radius);
  gl.uniform1f(shaderProgram.u_radOffset, faces.radOffset);
  gl.uniform1f(shaderProgram.u_target, faces.target);

  for (var i = 0; i < faces.length; i++) {
    gl.uniform3fv(shaderProgram.u_rot, toArray(faces[i].rot));

    gl.uniform1f(shaderProgram.useTexture, 1);
    gl.depthMask(false);
    gl.uniform1f(shaderProgram.u_z_off, 0.00005);
    gl.uniform1f(shaderProgram.useTexture, 0);
    //draw(cubeVertexIndexBufferFaceOutline, toArray(faces[i].linecolour), gl.LINE_STRIP)
    draw(cubeVertexIndexBufferAllTriOutline, toArray(faces[i].linecolour), gl.LINE_STRIP)
    gl.depthMask(true);

    if (faces[i].texture === undefined) {
      gl.uniform1f(shaderProgram.useTexture, 0);
    } else {
      gl.uniform1f(shaderProgram.useTexture, 1);
      gl.activeTexture(gl.TEXTURE0);
      gl.bindTexture(gl.TEXTURE_2D, faces[i].texture);
      gl.uniform1i(shaderProgram.samplerUniform, 0);
    }

    //gl.enable(gl.POLYGON_OFFSET_FILL);
    gl.uniform1f(shaderProgram.u_z_off, 0);
    draw(cubeVertexIndexBufferTriStrip, toArray(faces[i].colour), gl.TRIANGLE_STRIP)
    //gl.disable(gl.POLYGON_OFFSET_FILL);
    //gl.disable(gl.BLEND);
  }
}

function morphValue(limit, value, dt) {
  if (dt < 0)
    if (value > limit)
      value += dt;
    else
      value = limit;

  if (dt > 0)
    if (value < limit)
      value += dt;
    else
      value = limit;
  return value;
}

function morphSphere(face, animation) {
  var morpComplete = false;
  var target = (1 - 1 / Math.sqrt(3)) * (animation.radius);
  var stepsize = target / animation.rate;
  return function (dt) {
    if (morpComplete) return morpComplete;
    face.radOffset = morphValue(target, face.radOffset, dt * stepsize);
    morpComplete = target < face.radOffset;
    return morpComplete;
  }
}

function morphCube(face, animation) {
  var target = (1 - 1 / Math.sqrt(3)) * (animation.radius);
  var stepsize = -target / animation.rate;
  target = 0;
  return function (dt) {
    face.radOffset = morphValue(target, face.radOffset, dt * stepsize);
    return target === face.radOffset;
  }
}

function morphColour(face, animation) {
  return function (dt) {
    var old = { a: face.colour.a };
    face.colour.a = morphValue(animation.a.limit, face.colour.a, dt * animation.a.rate);
    return (old.a === face.colour.a);
  }
}

function morphLineColour(face, animation) {
  return function (dt) {
    var old = { a: face.linecolour.a };
    face.linecolour.a = morphValue(animation.a.limit, face.linecolour.a, dt * animation.a.rate);
    return (old.a === face.linecolour.a);
  }
}

function wrapAngle(angle, change) {
  if(change < 0)
    return
}

function morphAngleContinuous(face, animation) {
  return function (dt) {
    if (animation.x !== undefined) {
      face.rot.x += dt * animation.x.rate;
      face.rot.x = face.rot.x % toRad(360);
    }
    if (animation.y !== undefined) {
      face.rot.y += dt * animation.y.rate;
      face.rot.y = face.rot.y % toRad(360);
    }
    if (animation.z !== undefined) {
      face.rot.z += dt * animation.z.rate;
      face.rot.z = face.rot.z % toRad(360);
    }
    return true;
  }
}

function morphAngle(face, animation) {
  var morpComplete = false;
  return function (dt) {
    if (morpComplete) return morpComplete;
    var old = { x: face.rot.x, y: face.rot.y, z: face.rot.z };
    morpComplete = true;
    if (animation.x !== undefined) {
      face.rot.x = morphValue(animation.x.limit, face.rot.x, dt * animation.x.rate);
      morpComplete = old.x === face.rot.x;
    }

    if (animation.y !== undefined) {
      face.rot.y = morphValue(animation.y.limit, face.rot.y, dt * animation.y.rate);
      morpComplete = morpComplete && (old.y === face.rot.y);
    }

    if (animation.z !== undefined) {
      face.rot.z = morphValue(animation.z.limit, face.rot.z, dt * animation.z.rate);
      morpComplete = morpComplete && (old.z === face.rot.z);
    }
    return morpComplete;
  }
}

function morphPause(duration) {
  var duration = duration;
  return function (dt) {
    duration -= dt;
    return (duration < 0);
  }
}

function animate() {
  var now = new Date().getTime(),
			dt = now - (time || now);

  time = now;

  var finished = true;
  if (dt > 1) {
    for (var i = 0; i < animations[animations.current].length; i++) {
      finished = animations[animations.current][i](dt / 1000) && finished;
    }
    if (finished) {
      if (animations.length > 0) {
        animations.current++;
        if(  animations.current === animations.length) {
          animations.current = 0;
          initAnimations();
        }
      }
    }
  }
}

function tick() {
  requestAnimationFrame(tick);
  animate();
  drawAll();
}